n            <!-- ko foreach: $parent.getRegion('before-place-order') -->\r\n                <!-- ko template: getTemplate() --><!-- /ko -->\r\n            <!--/ko-->\r\n        </div>\r\n        <div class=\"actions-toolbar\">\r\n            <div class=\"primary\">\r\n                <button class=\"action primary checkout\"\r\n                        type=\"submit\"\r\n                        data-bind=\"\r\n                        click: placeOrder,\r\n                        attr: {title: $t('Place Order')},\r\n                        css: {disabled: !isPlaceOrderActionAllowed()},\r\n                        enable: (getCode() == isChecked())\r\n                        \"\r\n                        disabled>\r\n                    <span data-bind=\"i18n: 'Place Order'\"></span>\r\n                </button>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n        \r\n","Magento_OfflinePayments/template/payment/purchaseorder-form.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"payment-method\" data-bind=\"css: {'_active': (getCode() == isChecked())}\">\r\n    <div class=\"payment-method-title field choice\">\r\n        <input type=\"radio\"\r\n               name=\"payment[method]\"\r\n               class=\"radio\"\r\n               data-bind=\"attr: {'id': getCode()}, value: getCode(), checked: isChecked, click: selectPaymentMethod, visible: isRadioButtonVisible()\"/>\r\n        <label data-bind=\"attr: {'for': getCode()}\" class=\"label\">\r\n            <span data-bind=\"text: getTitle()\"></span>\r\n        </label>\r\n    </div>\r\n\r\n    <div class=\"payment-method-content\">\r\n        <!-- ko foreach: getRegion('messages') -->\r\n        <!-- ko template: getTemplate() --><!-- /ko -->\r\n        <!--/ko-->\r\n        <div class=\"payment-method-billing-address\">\r\n            <!-- ko foreach: $parent.getRegion(getBillingAddressFormName()) -->\r\n            <!-- ko template: getTemplate() --><!-- /ko -->\r\n            <!--/ko-->\r\n        </div>\r\n        <form id=\"purchaseorder-form\" class=\"form form-purchase-order\" data-role=\"purchaseorder-form\">\r\n            <fieldset class=\"fieldset payment method\" data-bind='attr: {id: \"payment_form_\" + getCode()}'>\r\n                <div class=\"field field-number required\">\r\n                    <label for=\"po_number\" class=\"label\">\r\n                        <span><!-- ko i18n: 'Purchase Order Number'--><!-- /ko --></span>\r\n                    </label>\r\n                    <div class=\"control\">\r\n                        <input type=\"text\"\r\n                               id=\"po_number\"\r\n                               name=\"payment[po_number]\"\r\n                               data-validate=\"{required:true}\"\r\n                               data-bind='\r\n                                attr: {title: $t(\"Purchase Order Number\")},\r\n                                value: purchaseOrderNumber'\r\n                               class=\"input-text\"/>\r\n                    </div>\r\n                </div>\r\n            </fieldset>\r\n        </form>\r\n        <div class=\"checkout-agreements-block\">\r\n            <!-- ko foreach: $parent.getRegion('before-place-order') -->\r\n                <!-- ko template: getTemplate() --><!-- /ko -->\r\n            <!--/ko-->\r\n        </div>\r\n        <div class=\"actions-toolbar\" id=\"review-buttons-container\">\r\n            <div class=\"primary\">\r\n                <button class=\"action primary checkout\"\r\n                        type=\"submit\"\r\n                        data-bind=\"\r\n                        click: placeOrder,\r\n                        attr: {title: $t('Place Order')},\r\n                        enable: (getCode() == isChecked()),\r\n                        css: {disabled: !isPlaceOrderActionAllowed()}\r\n                        \"\r\n                        data-role=\"review-save\">\r\n                    <span data-bind=\"i18n: 'Place Order'\"></span>\r\n                </button>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n        \r\n","Magento_Payment/template/payment/cc-form.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n\r\n<fieldset data-bind=\"attr: {class: 'fieldset payment items ccard ' + getCode(), id: 'payment_form_' + getCode()}\">\r\n    <!-- ko if: (isShowLegend())-->\r\n    <legend class=\"legend\">\r\n        <span><!-- ko i18n: 'Credit Card Information'--><!-- /ko --></span>\r\n    </legend><br />\r\n    <!-- /ko -->\r\n    <div class=\"field type\">\r\n        <div class=\"control\">\r\n            <ul class=\"credit-card-types\">\r\n                <!-- ko foreach: {data: getCcAvailableTypesValues(), as: 'item'} -->\r\n                <li class=\"item\" data-bind=\"css: {\r\n                                                 _active: $parent.selectedCardType() == item.value,\r\n                                                 _inactive: $parent.selectedCardType() != null && $parent.selectedCardType() != item.value\r\n                                                 } \">\r\n                    <!--ko if: $parent.getIcons(item.value) -->\r\n                    <img data-bind=\"attr: {\r\n                        'src': $parent.getIcons(item.value).url,\r\n                        'alt': item.type,\r\n                        'width': $parent.getIcons(item.value).width,\r\n                        'height': $parent.getIcons(item.value).height\r\n                        }\">\r\n                    <!--/ko-->\r\n                </li>\r\n                <!--/ko-->\r\n            </ul>\r\n            <input type=\"hidden\"\r\n                   name=\"payment[cc_type]\"\r\n                   class=\"input-text\"\r\n                   value=\"\"\r\n                   data-bind=\"attr: